insns = """



"""

def star1():
    digit = 5

    for line in insns.splitlines():
        for insn in line:
            if insn == "R":
                if (digit) // 3 == (digit-1) // 3:
                    digit += 1
            elif insn == "L":
                if digit > 1 and (digit-2) // 3 == (digit-1) // 3:
                    digit -= 1
            elif insn == "U":
                if digit > 3:
                    digit -= 3
            elif insn == "D":
                if digit < 7:
                    digit += 3
        print(digit, end="")
    print()

star1()

def star2():
    lines=["", "1", "234", "56789", "ABC", "D", ""]
    lines = "\n".join(line.center(5) for line in lines)
    i = lines.index("5")

    for line in insns.splitlines():
        for insn in line:
            if insn == "R":
                if not lines[i + 1].isspace():
                    i += 1
            elif insn == "L":
                if not lines[i - 1].isspace():
                    i -= 1
            elif insn == "U":
                if not lines[i - 6].isspace():
                    i -= 6
            elif insn == "D":
                if not lines[i + 6].isspace():
                    i += 6
        print (lines[i], end="")
    print()

star2()
